  {id: 8, activity_type: "Schedule, Rates, Booking", engagement_type: "", annual_value: "", status: true, date_opened: "2019-02-01 18:16:29", date_closed: nil, other_notes: "<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Hi Angelina,</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Just spoke on the phone.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Please send me your truck list for CA, AZ, and TX next week asap as we line up our loads well in advance.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We are looking for regular weekly service (5-10 trucks per week or more), year round on these lanes and when we commit, you can count on those loads every week.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We also offer quick pay at no additional charge.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We have been one of Deloitte and Touche&rsquo;s Best Managed Companies for the last 5 straight years.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We are also much better looking than our competition</span><span style=\"font-family: 'Segoe UI Emoji',sans-serif; mso-bidi-font-family: 'Segoe UI Emoji';\">😊</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Best Regards,</span></p>", carrier_id: 55, shipper_id: nil, date_stamp: "2019-01-03", user_id: 4, campaign_name: "", carrier_contact_id: 74, shipper_contact_id: nil, loads_per_week: "", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-01 18:16:29", updated_at: "2019-02-01 18:16:29", load_numbers: nil},
  {id: 9, activity_type: "Initial Prospecting", engagement_type: "", annual_value: "", status: true, date_opened: "2019-02-01 20:22:37", date_closed: nil, other_notes: "<p class=\"MsoNormal\">Hi There,</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Just following up as would like to talk more about establishing regular weekly service where you can count on having loads for your trucks every week, year round.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We can look at reserving anywhere from 1-5 or more trucks per week, specific loading days, etc.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">I&rsquo;ll plan on calling Danny again on Monday.<span style=\"mso-spacerun: yes;\">&nbsp; </span>In the meantime, please feel free to contact me anytime.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Have a great weekend.</p>", carrier_id: 60, shipper_id: nil, date_stamp: "2019-01-02", user_id: 4, campaign_name: "", carrier_contact_id: 64, shipper_contact_id: nil, loads_per_week: "", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-01 20:22:37", updated_at: "2019-02-01 20:22:37", load_numbers: nil},
  {id: 12, activity_type: "Initial Prospecting", engagement_type: "", annual_value: "0-5M", status: true, date_opened: "2019-02-19 17:23:59", date_closed: nil, other_notes: "<p>Pete introduced me to Alex who moves grapes out of Delano CA. I quoted him $4200 and he confirmed the rate was inline with the other carriers he is works with. Said he would be willing to work with Scout but at the moment he is not moving anything until grape season starts up again in a couple months. Check back in March &nbsp;</p>", carrier_id: nil, shipper_id: 55, date_stamp: "2019-07-01", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 27, loads_per_week: "2-5", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-19 17:20:59", updated_at: "2019-02-19 17:23:59", load_numbers: nil},
  {id: 11, activity_type: "Initial Prospecting", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-03-08 17:19:40", other_notes: "<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">spoke to Pete works 2 lanes Philadelphia-chicago and delaware-chicago. Quoted him $1500/1600 for both lanes and he said I was currently paying 1000/1100 including a $40 port fee. <span style=\"display: inline !important; float: none; background-color: #ffffff; color: #000000; font-family: Roboto,RobotoDraft,Helvetica,Arial,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; widows: 2; word-spacing: 0px;\">1000/1100 are truck rates. However, he claims he is getting those rates with CH Robinson. I am unable to provide these rates. He has referred me to Alex who pulls from West Coast </span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span style=\"display: inline !important; float: none; background-color: #ffffff; color: #000000; font-family: Roboto,RobotoDraft,Helvetica,Arial,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; widows: 2; word-spacing: 0px;\">CB: Approved.</span></span></p>", carrier_id: nil, shipper_id: 55, date_stamp: "2019-08-03", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 33, loads_per_week: "6-10", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-19 17:00:17", updated_at: "2019-03-08 17:19:40", load_numbers: nil},
  {id: 10, activity_type: "Initial Set-Up", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-02-19 16:35:28", other_notes: "<p>Set up in our system and moved 17 loads in January&nbsp;</p>", carrier_id: nil, shipper_id: 56, date_stamp: "2019-02-10", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 28, loads_per_week: "11-25", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-19 16:34:44", updated_at: "2019-02-19 16:35:28", load_numbers: nil},
  {id: 16, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-21 21:13:21", date_closed: "2019-02-21 21:17:26", other_notes: "", carrier_id: nil, shipper_id: 2, date_stamp: "2019-02-09", user_id: 4, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 4, loads_per_week: "2-5", outcome: "Learn", reason: "Satisficed", notes: "<p>Quoted 4500 for McAllen to Bronx.&nbsp; He's at 4300.&nbsp; Said if I can do 4250, we are in.&nbsp;&nbsp;</p>", reason_other: "", created_at: "2019-02-21 21:13:21", updated_at: "2019-02-21 21:17:26", load_numbers: nil},
  {id: 19, activity_type: "Initial Prospecting", engagement_type: "", annual_value: "0-5M", status: true, date_opened: "2019-02-25 21:35:46", date_closed: nil, other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">2/25: Connected with Wayland and introduced myself, said he was willing to give me a shot. Sent email, and he confirmed he got it and said he would be in touch </span></p>", carrier_id: nil, shipper_id: 87, date_stamp: nil, user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: nil, loads_per_week: "6-10", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-25 21:35:46", updated_at: "2019-02-25 21:35:46", load_numbers: nil},
  {id: 13, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-25 21:37:42", date_closed: "2019-03-08 17:40:49", other_notes: "<p><span style=\"color: #000000; font-family: docs-Calibri; font-size: 19px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Spoke to Shelly and she was very receptive. She confirmed her lanes and I sent her a quote. She says February is completely dead but she will give me a chance in a few months when she starts needing trucks again. South CA- Chicago: $3900, WA- Chicago $4300, Nogales- Chicago$3800, Yuma - Chicago $3900McAllen- Chicago $3200, FL - Chicago $1800MS- Chicago $1700, DE- Chicago $1400. 02/19: Reconnected with her and she confirmed the rates that I sent her were inline to her other carriers. She is going to Aruba next week. She is set up in our system and is willing to work with me when business picks up in April/May</span></p>", carrier_id: nil, shipper_id: 50, date_stamp: "2019-02-11", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 22, loads_per_week: "11-25", outcome: "Learn", reason: "Timing", notes: "<p>South CA- Chicago: $3900</p>\r\n<p>WA- Chicago&nbsp; &nbsp;$4300</p>\r\n<p>Nogales- Chicago $3800&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Yuma - Chicago $3900</p>\r\n<p>McAllen- Chicago $3200</p>\r\n<p>FL - Chicago&nbsp; $1800</p>\r\n<p>MS- Chicago&nbsp; $1800</p>\r\n<p>DE- Chicago&nbsp; $1400</p>\r\n<p>**Confirmed rates were good with her. However, DE- Chicago she said I was 1-200 high</p>\r\n<p>**300-400 margins so definately potential when business picks up April/May</p>\r\n<p>&nbsp;</p>\r\n<p>CB:&nbsp; Again, this should be open until the time they have volume to offer, but good learning here.&nbsp; Next time keep it open until the opportunity is real and current.</p>", reason_other: "", created_at: "2019-02-19 17:25:24", updated_at: "2019-03-08 17:40:49", load_numbers: nil},
  {id: 36, activity_type: "Proposal", engagement_type: "", annual_value: "25-100M", status: false, date_opened: nil, date_closed: "2019-03-11 12:49:16", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">*Spot McAllen to Vineland $4800 Billing and $4300 TT ** keep in mind this is last weeks prices Feb 15th</span></p>", carrier_id: nil, shipper_id: 102, date_stamp: "2019-01-02", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: 51, loads_per_week: "26-50", outcome: "Learn", reason: "Availability", notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">*Spot McAllen to Vineland $4800 Billing and $4300 TT ** keep in mind this is last weeks prices Feb 15th</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">* sent me an email on 11/02/2019 He told me he as no need to change transportation needs.</span></p>\r\n<p>CB Notes:&nbsp; There isn't enough information here for a Closed Loop.&nbsp; You note the Billing rate and TTT, but what happened?&nbsp;</p>\r\n<p>Did the customer accept?</p>\r\n<p>Need more detailed story.</p>", reason_other: "", created_at: "2019-03-04 14:12:28", updated_at: "2019-03-11 12:49:16", load_numbers: nil},
  {id: 26, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-03-08 17:47:21", other_notes: "<p>-Spoke to Joseph and he told me he currently pulls from from McAllen and Nogales. Quoted McAllen Tx- Chelsea MA $5300 and Nogales- Chelsea MA $5800 ($500 Margins)</p>\r\n<p>-He said I was $100-200 off what he is currently paying.&nbsp;</p>\r\n<p>-Told him I could be where he needs to be however he said that he isn't really interested in working with new carriers as he is \"old and ready to retire in a few months\"</p>", carrier_id: nil, shipper_id: 91, date_stamp: "2019-02-11", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 40, loads_per_week: "2-5", outcome: "Learn", reason: "Satisficed", notes: "<p>-Spoke to Joseph and he told me he currently pulls from from McAllen and Nogales. Quoted McAllen Tx- Chelsea MA $5300 and Nogales- Chelsea MA $5800 ($500 Margins)</p>\r\n<p>-TTT Rate: McAllen Tx- Chelsea MA $4800 and Nogales- Chelsea MA $5300</p>\r\n<p>-Over quoted by 100-200</p>\r\n<p>-No new carriers needed, retiring in a few months</p>\r\n<p>CB: Approved,<strong> but find out who is taking over from the old guy!</strong></p>", reason_other: "", created_at: "2019-03-01 15:48:55", updated_at: "2019-03-08 17:47:21", load_numbers: nil},
