  {id: 38, activity_type: "Proposal", engagement_type: "", annual_value: "5-10M", status: false, date_opened: nil, date_closed: "2019-03-11 13:02:26", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">Above * Prosser wa to JESSUP MD is Billing clients 6100 * as Per the rates in Washington according to Jonah.</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\"> He ( Steve) wanted me to be at 5700. trucks are asking 5600.</span></p>", carrier_id: nil, shipper_id: 104, date_stamp: "2019-02-01", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: 53, loads_per_week: "6-10", outcome: "Learn", reason: "Price", notes: "<p>CB:&nbsp; Again, no learnings in this section, but the notes are a bit confusing.&nbsp; Is 6100, or 5700 the billing rate?&nbsp; If the customer is at 5700, where does the 6100 come from. &nbsp;</p>\r\n<p><strong>Again, this is one where if you were this close, you have to find a way to make it happen.</strong></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">* Asked for me to lower my rates but the margins are virtually non present.</span></p>", reason_other: "", created_at: "2019-03-04 14:46:47", updated_at: "2019-03-11 13:02:26", load_numbers: nil},
