  {id: 20, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-25 21:43:26", date_closed: "2019-03-08 17:45:51", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">-sent quote to Josh. South CA- Chicago:$4000, WA-Chicago $4300, Nogales-Chicago $3800 Yuma - Chicago: $4000, McAllen- Chicago: $3200, FL-Chicago: $1800. He confirmed rates were in line to what he is paying currently and said he will give me a shot next time he has something. Quoted Sharp with only $300 margins</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">-Spoke to Josh and he told me that he will reach out if he needs a truck. I then offered him $200 off of his first 3 loads to get this rolling and he was receptive. Sent over the application and he said he would forward it to accounting to fill out. </span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">-Keeps telling me my rates are good but now tells me he has no need for new carriers at the moment and he'll reach out if he needs a truck that his regulars can't cover.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>", carrier_id: nil, shipper_id: 47, date_stamp: "2019-02-05", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 21, loads_per_week: ">50", outcome: "Learn", reason: "Satisficed", notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">South CA- Chicago:$4000, WA-Chicago $4300, Nogales-Chicago $3800 Yuma - Chicago: $4000, McAllen- Chicago: $3200, FL-Chicago: $1800. He confirmed rates were in line to what he is paying</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">- Quoted Sharp with only $300 margins</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">**Keeps telling me my rates are good but now tells me he has no need for new carriers at the moment and he'll reach out if he needs a truck that he's regulars can't cover.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; white-space: pre-wrap;\">CB: Approved and classic satisficed. Great effort on the New Customer Incentive Rebate. I would stay on top of this one!</span></p>", reason_other: "", created_at: "2019-02-25 21:42:35", updated_at: "2019-03-08 17:45:51", load_numbers: nil},
  {id: 17, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-03-11 15:07:50", date_closed: "2019-03-11 15:20:56", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">spoke to Lou and he told me business is slow right now but he is moving about 3-4 loads per week from South Cali-cleveland, mcallen- cleveland and nogales-Cleveland. I sent him a quote: California- $4300-$4400 Nogales - $4200, McAllen - $ 3900. He reponded back to my email that my rates were good so I sent him over our customer application. Might be tough to win over as he mentioned that the owners brother is in logistics but I will keep trying </span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">-Reveived app back from lou. Unfortunately he included transportation references rather then shippers. Also account # and signature was missing. awaiting missing details. </span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">-He said that he would send me the missing details however mentioned that he really won't be needing any additional carriers for a few months when business picks up</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">&nbsp;</span></p>", carrier_id: nil, shipper_id: 79, date_stamp: "2022-02-05", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 35, loads_per_week: "2-5", outcome: "Win", reason: "Price", notes: "<p>-Runs 3 Lanes: <span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">South Cali-cleveland, mcallen- cleveland and nogales-Cleveland.</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">-Quoted </span><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">California- $4300-$4400 Nogales - $4200, McAllen - $ 3900 