  {id: 34, activity_type: "Proposal", engagement_type: "", annual_value: "100M+", status: false, date_opened: nil, date_closed: "2019-03-14 13:20:42", other_notes: "<p>&nbsp;<span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">*Spot on $2800 Billing to the Bronx, paying Trucks $2300 from, Florida</span></p>", carrier_id: nil, shipper_id: 101, date_stamp: "2019-01-02", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: 50, loads_per_week: ">50", outcome: "Learn", reason: "Availability", notes: "<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\"><span style=\"font-size: 19px;\">*Spot on $2800 Billing to the Bronx From Florida. Paying Trucks $2300 from, Florida</span></span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">*Currently Running LTL will give me business when he transitions. At this point he is not switching from LTL. Told me there is not room for new business.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">CB Notes: This could be a good opportunity when he transitions to TL, but it isn't a Closed Loop. Keep it Open and CLOSE it as a WIN when you get the first load.</span></p>", reason_other: "", created_at: "2019-03-04 14:02:07", updated_at: "2019-03-14 13:20:42", load_numbers: nil},
  {id: 18, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-25 20:42:30", date_closed: "2019-03-08 17:25:24", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">reconnected with Joe and got more details regarding his lane: loads in Dinuba usually around 5pm then the following morning needs fumigation in Quartsite AZ then delivers late evening in phoenix . He is currently paying $1800. sent application. waiting for confirmation if that rate includes unloading and fumigation...Currently moving 7 loads per week and said that currently he has enough carriers until May when he will start moving 15+ loads per week</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 15px; white-space: pre-wrap;\">-Willing to work with us in a few months if i cant beat his current rate</span></p>", carrier_id: nil, shipper_id: 53, date_stamp: "2019-08-03", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 25, loads_per_week: "6-10", outcome: "Learn", reason: "Satisficed", notes: "<p>-Dinuba CA-Fumigation in Quartsite AZ-Phoenix AZ currently paying $1800+ fumigation cost (he covers)</p>\r\n<p>-Currently happy with his regular carriers but said he is willing to work with me in May when load volume increases to 15+/week</p>\r\n<p>-current ttt rate about $1600. Spoke to dan at saxon trans located in delano ca and he was receptive at $1500</p>\r\n<p>- I will keep reaching out to carriers to see if i can get to the rates Joe needs while also being profitable for me</p>\r\n<p>CB Notes:&nbsp; I will make an exception on this, but next time, keep this Open and Close it as a WIN when you get your first load!&nbsp; There isn't a current opportunity, but there is in May, so that's a Loop in the bag for May - PIPELINE. &nbsp;</p>", reason_other: "", created_at: "2019-02-25 20:42:30", updated_at: "2019-03-08 17:25:24", load_numbers: nil},
  {id: 25, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-03-08 17:31:19", other_notes: "<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-Spoke to Don and got details on his lanes, sent quote with rates. South CA- Chicago $3800, WA-Chicago $4200, Nogales-Chicago $3700, Yuma - Chicago: $3800, McAllen- Chicago: $3200, FL-Chicago $1800</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-After trying to follow up several times to see if my rates were good, I finally caught him on the phone and he told me that my rates were good but unfortunately he is not interested in any new carriers as he has enough already.</span></p>\r\n<p>&nbsp;</p>", carrier_id: nil, shipper_id: 44, date_stamp: "2019-01-03", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 20, loads_per_week: "26-50", outcome: "Learn", reason: "Satisficed", notes: "<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Quoted sharp on his lanes: South CA- Chicago $3800, WA-Chicago $4200, Nogales-Chicago $3700, Yuma - Chicago: $3800, McAllen- Chicago: $3200, FL-Chicago $1800 ($300 Margins)</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Rate good, but not interested in any new carriers as he has enough already.</span></p>\r\n<p>&nbsp;</p>\r\n<p>CB:&nbsp; Classic Satisficed, but also an opportunity to improve on qualification, e.g. \"Don, we want to work with you and I will work hard to get you great service and rates, <strong>but if I provide good rates, will you give me an opportunity? &nbsp;</strong></p>\r\n<p>What if you went back to him with a limited time rebate offer, to cover his switching costs, e.g. $100-200 per load (depedning on value of load, etc.) for 30 days, as long as he does at least 3 loads per week. &nbsp;</p>", reason_other: "", created_at: "2019-03-01 14:18:51", updated_at: "2019-03-08 17:31:19", load_numbers: nil},
  {id: 47, activity_type: "Proposal", engagement_type: "", annual_value: "10-25M", status: false, date_opened: nil, date_closed: "2019-03-11 13:11:13", other_notes: "<p><span style=\"font-size: 14pt; font-family: Calibri, Arial; font-weight: bold;\" data-sheets-userformat=\"{&quot;2&quot;:29635,&quot;3&quot;:{&quot;1&quot;:0},&quot;4&quot;:[null,2,16777215],&quot;9&quot;:0,&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0,&quot;15&quot;:&quot;Calibri&quot;,&quot;16&quot;:14,&quot;17&quot;:1}\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;* Above, he wanted to be at $2000 for Philly. $2200 is what we are paying trucks. &quot;}\">* Above, he wanted to be at $2000 for Philly. $2200 is what we are paying trucks. From Belle Glade , FL</span></p>", carrier_id: nil, shipper_id: 111, date_stamp: "2019-01-02", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: 61, loads_per_week: "6-10", outcome: "Learn", reason: "Price", notes: "<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">* Above, he wanted to be at $2000 for Philly. $2200 is what we are paying trucks. </span><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">*told Geoff to call me when he is in bind because the rates are really sharp</span></p>", reason_other: "", created_at: "2019-03-04 17:08:59", updated_at: "2019-03-11 13:11:13", load_numbers: nil},
  {id: 48, activity_type: "Proposal", engagement_type: "", annual_value: "10-25M", status: false, date_opened: nil, date_closed: "2019-03-11 13:12:47", other_notes: "<p><span style=\"font-size: 14pt; font-family: Calibri, Arial; font-weight: bold;\" data-sheets-userformat=\"{&quot;2&quot;:29635,&quot;3&quot;:{&quot;1&quot;:0},&quot;4&quot;:[null,2,16777215],&quot;9&quot;:0,&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0,&quot;15&quot;:&quot;Calibri&quot;,&quot;16&quot;:14,&quot;17&quot;:1}\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Above. Nogales to Ontario TT rates are $4500. He wanted to pay me $4700&quot;}\">Above. Nogales to Ontario TT rates are $4500. He wanted to pay me $4700</span></p>", carrier_id: nil, shipper_id: 112, date_stamp: "2019-01-02", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: 62, loads_per_week: "6-10", outcome: "Learn", reason: "Price", notes: "<p><span style=\"font-size: 14pt; font-family: Calibri, Arial; font-weight: bold;\" data-sheets-userformat=\"{&quot;2&quot;:29635,&quot;3&quot;:{&quot;1&quot;:0},&quot;4&quot;:[null,2,16777215],&quot;9&quot;:0,&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0,&quot;15&quot;:&quot;Calibri&quot;,&quot;16&quot;:14,&quot;17&quot;:1}\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Above. Nogales to Ontario TT rates are $4500. He wanted to pay me $4700&quot;}\">Above. Nogales to Ontario TT rates are $4500. He wanted to pay me $4700</span></p>\r\n<p>&nbsp;</p>\r\n<p>CB Notes:&nbsp; This one is pretty clsoe so I'd like to think we could have found a truck to get this done at 4300-4400, but even if we couldn't, <strong>why wouldn't we take this at 4700 to get some traction with this customer?&nbsp; Have we followed up with this customer?</strong></p>\r\n<p>** I have followed up with this client since. Still working.</p>\r\n<p>&nbsp;</p>", reason_other: "", created_at: "2019-03-04 17:20:57", updated_at: "2019-03-11 13:12:47", load_numbers: nil},
  {id: 52, activity_type: "Proposal", engagement_type: "", annual_value: "10-25M", status: false, date_opened: nil, date_closed: "2019-03-11 14:57:33", other_notes: "<p>McAllen, TX to Spokane.&nbsp;</p>\r\n<p>Lars offered me a 4 picker to Spokane, WA</p>\r\n<p>He wanted to pay me $4800 , trucks are asking for $4700 Min.</p>\r\n<p>Margins are too low to entertain this.&nbsp;</p>", carrier_id: nil, shipper_id: 66, date_stamp: "2019-11-03", user_id: 19, campaign_name: "March Prospects", carrier_contact_id: nil, shipper_contact_id: 82, loads_per_week: "6-10", outcome: "Learn", reason: "Price", notes: "<p>McAllen, TX to Spokane.&nbsp;</p>\r\n<p>Lars offered me a 4 picker to Spokane, WA</p>\r\n<p>He wanted to pay me $4800 , trucks are asking for $4700 Min.</p>\r\n<p>Margins are too low to entertain this.</p>", reason_other: "", created_at: "2019-03-11 14:57:33", updated_at: "2019-03-11 14:57:33", load_numbers: nil},
  {id: 53, activity_type: "Email", engagement_type: "", annual_value: "10-25M", status: false, date_opened: nil, date_closed: "2019-03-11 15:05:48", other_notes: "<p>Jon offered me a load.&nbsp;</p>\r\n<p>He needed a team McAllen to Modesto.</p>\r\n<p>Trucks were asking $3800 He wanted to Bill $4200.&nbsp;</p>\r\n<p>However he wanted it sooner the team I had said they can be in on Monday.</p>\r\n<p>He decided to go with the faster option.&nbsp;</p>", carrier_id: nil, shipper_id: 80, date_stamp: "2019-11-03", user_id: 19, campaign_name: "March Prospects", carrier_contact_id: nil, shipper_contact_id: 76, loads_per_week: "6-10", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-03-11 15:05:48", updated_at: "2019-03-11 15:05:48", load_numbers: nil},
