  {id: 65, activity_type: "Proposal", engagement_type: "", annual_value: "10-25M", status: false, date_opened: nil, date_closed: "2019-03-14 18:02:22", other_notes: "<p>I called him 14/03/2019 at 9:30. To follow up and he offered me a load. He wanted to be $5200 from Nogales, Az to Toronto food Terminal. 1/1</p>\r\n<p>Made some calls to my contacts and found a truck at a rate of $4700 for the 1/1.</p>\r\n<p>I called him back to get the load details and he stated that the product didn't cross Mexico.</p>", carrier_id: nil, shipper_id: 112, date_stamp: nil, user_id: 19, campaign_name: "March Prospects", carrier_contact_id: nil, shipper_contact_id: 62, loads_per_week: "2-5", outcome: "Win - Customer Drop", reason: "Other", notes: "", reason_other: "", created_at: "2019-03-14 18:02:22", updated_at: "2019-03-14 18:02:22", load_numbers: 5},
  {id: 14, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-20 20:59:37", date_closed: "2019-03-08 17:35:00", other_notes: "<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">-sara says she will need help with delivering from Delano CA- to port of los angeles. I quoted her $1200 however she told me she pays $900 with her regular carriers. I Told her I would try to work with my carriers to bring the rate down to where she needs to be.</span><u></u></p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">- Made some calls and found out rate TTT was $900, might be able to squeeze $800 will keep hunting</span></p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">-Carriers would require a twic card for the port</span></p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">- Does not require trucks until May/June when they start shipping grapes again in volumes </span></p>", carrier_id: nil, shipper_id: 54, date_stamp: "2019-08-03", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 26, loads_per_week: "11-25", outcome: "Learn", reason: "Timing", notes: "<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\"> -I quoted her $1200 however she told me she pays $900 with her regular carriers</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-Rate TTT is $800-$900 and carrier requires </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">twic card </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-No margins as of right now but I will keep running the opportunity by carriers located around the delano area</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- Does not require trucks until May/June</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">CB: Again, will make an exception this time, but next time, keep it open unti when the real opportunity comes up - PIPELINE. Still good learning on rates though!</span></p>", reason_other: "", created_at: "2019-02-20 20:59:37", updated_at: "2019-03-08 17:35:00", load_numbers: nil},
  {id: 5, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: "2019-02-19 15:56:06", date_closed: "2019-03-08 17:42:29", other_notes: "<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"> -Spoke to Arlene who confirmed she does contracted rates. Currently Paying Laredo TX-MD $5500,&nbsp; and Laredo TX-FL $4800. Quoted her <span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Quoted her $5000 for MD and $4200 for FL,. She only runs Team loads with 2 day transit</span></span></p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><s