space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">- Nelson confirmed at this point they do not need new carriers</span></span></p>\r\n<p><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span style=\"color: #000000; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">-Contract is up for renewal in August </span></span></p>", carrier_id: nil, shipper_id: 35, date_stamp: "2018-12-03", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 37, loads_per_week: "11-25", outcome: "Learn", reason: "Satisficed", notes: "<p>What I Learned</p>\r\n<p>- They run contracted rates for 2 lanes: <span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Laredo TX-MD $5500,&nbsp; and Laredo TX-FL $4800 </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- Current team rate TTT: </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Laredo TX-MD $4400-$4600,&nbsp; and Laredo TX-FL $3600-3700</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- Contract Up for Renewal in August </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- They Require Teams Only </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-2 day transit time (not including loading day) 24 hour receiving </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-It will make sense to reconnect in July</span></p>\r\n<p>CB: Will make an exception this time, but doesn't appear that there is a real and current opportunity here, but a good one to follow up on.</p>", reason_other: "", created_at: "2019-01-08 14:35:54", updated_at: "2019-03-08 17:42:29", load_numbers: nil},
  {id: 23, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-03-08 17:50:42", other_notes: "<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- Spoke to Stephanie and she confirmed that have their own trucks. However in October she said they start outsourcing to keep up with demand. Require trucks running from Reedly CA- NY and </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Reedly CA- </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">NJ</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-Quoted her </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\"> Reedly CA- NY current rate of $5500 and $5400 for </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Reedly CA- </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">NJ and she said that the rates sounded right for this time of year ($500 margins)</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- Call back later in the year before October </span></p>", carrier_id: nil, shipper_id: 90, date_stamp: "2019-02-08", user_id: 11, campaign_name: "", carrier_contact_id: nil, shipper_contact_id: 39, loads_per_week: "11-25", outcome: "Learn", reason: "Timing", notes: "<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-Quoted her </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\"> Reedly CA- NY current rate of $5500 and $5400 for </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Reedly CA- </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">NJ and she said that the rates sounded right for this time of year </span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">-</span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Reedly CA- NY TTT Rate: $5000 , </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Reedly CA- </span><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">NJ TTT Rate $4900</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">- They have their own trucks and do not outsource until October, call back September.</span></p>\r\n<p><span style=\"font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\"><br />CB: You know what I'm going to say here. Good job, but next time, this should be open until the Fall when the opportunity is REAL and CURRENT. Still - good learning.</span></p>", reason_other: "", created_at: "2019-02-28 21:36:45", updated_at: "2019-03-08 17:50:42", load_numbers: nil},
  {id: 37, activity_type: "Proposal", engagement_type: "", annual_value: "0-5M", status: false, date_opened: nil, date_closed: "2019-03-11 12:51:16", other_notes: "<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">* Closed Juan Carlos is telling me he does not have the business to take from his long time carriers.Refusing to switch.</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; text-align: center; white-space: pre-wrap;\">**Closed-- potential client is refusing to switch even with rebates are offered. </span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 19px; font-weight: bold; white-space: pre-wrap;\">Above Juan Carlos pays $5200 for the freight/However there are multidrops. I'm a couple hundred above the rate with him. Mcallen to BRONX AND CHELSEA ,MA Trucks are asking fo $5500 for this.</span></p>", carrier_id: nil, shipper_id: 103, date_stamp: "2019-01-03", user_id: 19, campaign_name: "February Prospects", carrier_contact_id: nil, shipper_contact_id: nil, loads_per_week: "6-10", outcome: "Learn", reason: "Price", notes: "<p>CB:&nbsp; There's no learnings here, but based on above, it actually looks like you were close on rate.&nbsp; A two drop split between Bronx and Boston goes for 5200-5400 TTT.&nbsp; Not sure where the 6500 number is coming from and how that relates to the 'couple hundred above statement' so that's confusing. &nbsp;</p>\r\n<p>Follow up notes **&nbsp;<span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">* Closed Juan Carlos is telling me he does not have the business to take from his long time carriers.Refusing to switch.</span></p>\r\n<p><span style=\"font-family: docs-Calibri; font-size: 16px; font-weight: bold; white-space: pre-wrap;\">*Typo Trucks are asking $5500.</span></p>\r\n<p>&nbsp;</p>", reason_other: "", created_at: "2019-03-04 14:31:08", updated_at: "2019-03-11 12:51:16", load_numbers: nil},
