  {id: 120, title: "Main Decision Maker", email: "pgtdispatch9@gmail.com", carrier_id: 113, last_name: "", same_ho: false, first_name: "Joe", linkedin_link: "", location_id: 275, created_at: "2019-02-15 17:07:06", updated_at: "2019-02-15 17:07:06", contact_type: "Dispatch & Operations", adm: false, primary_phone: "(956) 642-7284", primary_phone_type: "", secondary_phone: "", secondary_phone_type: "", city: "San Benito ", address: "401 Mockingbird St", state: "TX", postal: "78586", country: "USA", primary_extension_number: nil, secondary_extension_number: nil, notes: "<p>Joe is the main contact for moving trucks - he was very willing to do business with us</p>", primary_eligible_texting: false, secondary_eligible_texting: false},
  {id: 121, title: "Owner", email: "tripleaxlecarrier@hotmail.com", carrier_id: 114, last_name: "Tecchio", same_ho: false, first_name: "Oliver", linkedin_link: "", location_id: 277, created_at: "2019-02-15 17:46:28", updated_at: "2019-02-15 17:46:28", contact_type: "Owner", adm: false, primary_phone: "(346) 300-7426", primary_phone_type: "Cell", secondary_phone: "", secondary_phone_type: "", city: "Houston", address: "6911 Walton Heath Drive", state: "TX", postal: "77069", country: "USA", primary_extension_number: nil, secondary_extension_number: nil, notes: "<p>Oliver is the Owner and is also one of the drivers.&nbsp;</p>", primary_eligible_texting: true, secondary_eligible_texting: false},
  {id: 117, title: "Owner", email: "amandeepchatha88@hotmail.in", carrier_id: 109, last_name: "", same_ho: false, first_name: "Amandeep", linkedin_link: "", location_id: 284, created_at: "2019-02-13 20:00:50", updated_at: "2019-02-18 01:29:58", contact_type: "Owner", adm: false, primary_phone: "(587) 968-6035", primary_phone_type: "Cell", secondary_phone: "", secondary_phone_type: "", city: "Calgary", address: "119 SAVANNA GROVE", state: "", postal: "T3J0V6", country: "Canada", primary_extension_number: nil, secondary_extension_number: nil, notes: "<p>Amandeep explained he prefers communicating through email - he was easy to talk to on the phone. He said we can reach out to either email and he will response quickly.&nbsp;</p>\r\n<p>Wiling to give us trucks. Sounded very welcoming on the phone.&nbsp;</p>", primary_eligible_texting: true, secondary_eligible_texting: false},
  {id: 125, title: "Owner", email: "venian@rubikenterprises.com", carrier_id: 112, last_name: "Olivas", same_ho: true, first_name: "Venian ", linkedin_link: "https://www.linkedin.com/in/venian-olivas-24450630/", location_id: 285, created_at: "2019-02-18 16:30:03", updated_at: "2019-02-18 16:30:03", contact_type: "Owner", adm: false, primary_phone: "(956) 530-7599", primary_phone_type: "Cell", secondary_phone: "", secondary_phone_type: "", city: "", address: "", state: "", postal: "", country: "USA", primary_extension_number: nil, secondary_extension_number: nil, notes: "<p>Venian has his own fleet of 10 trucks now, but is also a sales agent for Cano and Sons (50+ reefer outfit)&nbsp; out of McAllen.&nbsp; He used to be their General Manager.</p>\r\n<p>His rates are pretty high.&nbsp; Claims on 2/15/2019 that he can get 5100 for dry freight from McAllen to Bronx, and we are offering 4300.&nbsp;&nbsp;</p>\r\n<p>He gets back to McAllen mostly through loads from East Coast back to Houston.&nbsp; He gets $2600 back from NJ/PA to Houston, and then 500-600 bucks from Houston to McAllen if he is lucky.&nbsp; That's a 2.07 per mile round trip.&nbsp; He claims he gets over 2 bucks per mile round trip 80% of the time.&nbsp; Generally getting between 7 and 8K round trip, sometimes a little more.</p>\r\n<p>But, he is a good guy who knows a lot about the industry and is open to opportunities and thinking outside the box, so worth staying in touch.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>", primary_eligible_texting: true, secondary_eligible_texting: false},
