  {id: 72, title: "Dispatch (Decison Maker)", email: "danieltrucking2@gmail.com", carrier_id: 71, last_name: "", same_ho: true, first_name: "Konstantine", linkedin_link: "", location_id: 268, created_at: "2019-02-01 17:48:29", updated_at: "2019-03-13 18:50:35", contact_type: "Dispatch & Operations", adm: true, primary_phone: "(224) 477-1700", primary_phone_type: "Land Line", secondary_phone: "", secondary_phone_type: "", city: "Des Plaines", address: "1347 S PERRY ST #4", state: "", postal: "", country: "USA", primary_extension_number: "", secondary_extension_number: nil, notes: "<p>Konstantine confirmed to me that he can make decisions on where his trucks are going. Prefers work number and will take calls at any time of the day.&nbsp;</p>", primary_eligible_texting: false, secondary_eligible_texting: false},
