  {id: 43, title: "Owner ", email: "", carrier_id: 10, last_name: "", same_ho: true, first_name: "Zack ", linkedin_link: "", location_id: 89, created_at: "2019-01-22 16:46:08", updated_at: "2019-03-13 18:50:35", contact_type: "Owner", adm: false, primary_phone: "(702) 540-1677", primary_phone_type: "Cell", secondary_phone: "(702) 998-5922", secondary_phone_type: "Land Line", city: "", address: "", state: "", postal: "", country: "USA", primary_extension_number: nil, secondary_extension_number: "", notes: "<p>Zack doesnt like 100 people calling. I normally run through new loads with him to get rates and availability,</p>\r\n<p>Have worked with him for almost a decade.&nbsp;</p>", primary_eligible_texting: false, secondary_eligible_texting: false},
  {id: 89, title: "", email: "menalogisticsllc@gmail.com", carrier_id: 84, last_name: "", same_ho: false, first_name: "Rubin", linkedin_link: "", location_id: 260, created_at: "2019-02-04 18:02:48", updated_at: "2019-03-13 18:50:35", contact_type: "Dispatch & Operations", adm: false, primary_phone: "(956) 205-5392", primary_phone_type: "Cell", secondary_phone: "(956) 688-5700", secondary_phone_type: "Land Line", city: "", address: "", state: "", postal: "", country: "USA", primary_extension_number: nil, secondary_extension_number: "", notes: "<p>Owner isn't hands on.&nbsp; Leaves dispatch decisions to Rubin.&nbsp;&nbsp;</p>\r\n<p>TEXT Rubin at 7 AM and he can usually get trucks confirmed by 9 AM.&nbsp; They run 95% out of McAllen but may do other routes in the summer time.&nbsp;&nbsp;</p>", primary_eligible_texting: false, secondary_eligible_texting: false},
