  {id: 3, carrier_id: 84, shipper_id: nil, activity_id: nil, user_id: 4, reminder_date: "2019-02-05", reminder_interval: 0, recurring: false, created_at: "2019-02-04 18:05:00", updated_at: "2019-02-05 00:01:06", last_reminded: "2019-02-05", notes: "<p>Call Rubin and see if we can look at getting regular trucks.&nbsp;&nbsp;</p>", reminder_type: "Initial Interview"},
  {id: 6, carrier_id: 65, shipper_id: nil, activity_id: nil, user_id: 4, reminder_date: "2019-02-06", reminder_interval: 0, recurring: false, created_at: "2019-02-04 19:34:23", updated_at: "2019-02-06 00:01:04", last_reminded: "2019-02-06", notes: "", reminder_type: "Follow-up"},
  {id: 29, carrier_id: 167, shipper_id: nil, activity_id: nil, user_id: 16, reminder_date: "2019-03-11", reminder_interval: 0, recurring: false, created_at: "2019-03-06 16:25:30", updated_at: "2019-03-11 00:01:03", last_reminded: "2019-03-11", notes: "<p>Follow up with Matthew / JD</p>", reminder_type: "Follow-up"},
  {id: 44, carrier_id: 181, shipper_id: nil, activity_id: nil, user_id: 16, reminder_date: "2019-03-12", reminder_interval: 0, recurring: false, created_at: "2019-03-07 20:53:27", updated_at: "2019-03-12 00:01:04", last_reminded: "2019-03-12", notes: "<p>Follow up with Jay for available trucks</p>", reminder_type: "Follow-up"},
  {id: 4, carrier_id: 55, shipper_id: nil, activity_id: nil, user_id: 4, reminder_date: "2019-03-05", reminder_interval: 0, recurring: false, created_at: "2019-02-04 18:12:19", updated_at: "2019-03-05 00:01:02", last_reminded: "2019-03-05", notes: "<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Hi Angelina,</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Hope you had a great Superbowl weekend.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Following up on my email from below.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Would love to get regular weekly trucks set up out of AZ, CA, or TX &ndash; year round.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We pay in full upon delivery and have steady volumes on many lanes throughout the year.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">You mentioned you were going to send me your truck list for this week, which would be a great start. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Please let me know we can move forward from here.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Best,</span></p>", reminder_type: "Follow-up"},
  {id: 8, carrier_id: nil, shipper_id: 2, activity_id: nil, user_id: 4, reminder_date: "2019-02-26", reminder_interval: 7, recurring: false, created_at: "2019-02-21 21:08:27", updated_at: "2019-03-05 00:01:02", last_reminded: "2019-03-05", notes: "<p>Said he would have a load for me.</p>", reminder_type: "Follow-up"},
  {id: 39, carrier_id: 48, shipper_id: nil, activity_id: nil, user_id: 17, reminder_date: "2019-03-15", reminder_interval: 7, recurring: false, created_at: "2019-03-07 19:32:44", updated_at: "2019-03-15 00:01:03", last_reminded: "2019-03-15", notes: "<p>ASk for Next Truck availibility&nbsp; AZ Singles Only to M/W&nbsp; IL , WI.&nbsp; 30-0 miles Radius 2</p>\r\n<p>2 x R = Tolleson AZ - Chicago IL - March 12th - EK&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>", reminder_type: "Check Capacity"},
  {id: 12, carrier_id: 115, shipper_id: nil, activity_id: nil, user_id: 16, reminder_date: "2019-03-06", reminder_interval: 0, recurring: false, created_at: "2019-03-05 17:03:12", updated_at: "2019-03-06 00:01:03", last_reminded: "2019-03-06", notes: "<p>Follow up with Vanessa to see if she has a texas truck&nbsp;</p>", reminder_type: "Follow-up"},
