_profile\"><span class=\"msg-s-message-group__name t-14 t-black t-bold hoverable-link-text\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1.4rem; vertical-align: baseline; background: 0px 0px; color: var(--ui-accent-blue); line-height: 1.42857;\">Amanda Abergel</span></a>&nbsp;<time class=\"msg-s-message-group__timestamp t-12 t-black--light t-normal\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1.2rem; vertical-align: baseline; background: 0px 0px; color: var(--ui-typography-black--light); line-height: 1.33333;\">&nbsp;3:30 PM</time></div>\r\n<div class=\"msg-s-event-listitem__message-bubble\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: 0px 0px #f5f5f5; display: inline-block; max-width: 100%; position: relative; color: rgba(0, 0, 0, 0.9); font-family: -apple-system, system-ui, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', 'Fira Sans', Ubuntu, Oxygen, 'Oxygen Sans', Cantarell, 'Droid Sans', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol', 'Lucida Grande', Helvetica, Arial, sans-serif;\">\r\n<p class=\"msg-s-event-listitem__body t-14 t-black--light t-normal \" style=\"box-sizing: inherit; margin: 0px; padding: 0px 8px 0px 56px; border: 0px; outline: 0px; font-size: 1.4rem; vertical-align: baseline; background: 0px 0px; line-height: 1.42857; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; white-space: pre-line;\">Hi Michael, I tried ringing you today but wasn't able to reach you. I was wanting to talk to you (or the right person @ Berry People LLC) to see if there was any potential opportunity to open a new relationship with you in terms of transportation. Right now, we do a lot of business with Red Blossom, Fortune Growers, Dole, Del Monte, Whole Foods, Giumarra and more. Would it be of any value for us to connect as well? I see we have some of the same connections as well, including Dave @ Plan Berries who I am in touch with often.</p>\r\n</div>", credit_status: nil, credit_approval: nil, origin: nil, destination: nil, head_office: 73, annual_revenue: nil, created_at: "2019-02-14 20:36:26", updated_at: "2019-02-14 20:37:08", years_in_business: 0, complete_record: false, website: "https://berrypeople.com/", linkedin: "https://www.linkedin.com/in/michael-osumi-005aba134/", sales_priority: "", shipper_type: "", control_freight: false, loads_per_month: "", spend_per_year: "", commodities: "Avocado,Berries,Blackberry,Blueberry,Strawberry", commodities_notes: "", blue_book_score: "814", blue_book_url: "https://apps.bluebookservices.com/BBOS/CompanyDetailsSummary.aspx?CompanyID=340329", buying_criteria: "", works_with_brokers: true, price_sensitivity: "", challenges: "", current_carrier_mix: "", prefer_teams: false, last_contact_by: nil, last_contact: nil, relationship_owner: 9, load_last_month: 0, load_last_6_month: 0, approved: false, date_approved: nil, years_established: nil},
