  {id: 46, company_name: "Natureipe Farms (Avocado) ", parent_id: nil, phone: "(239) 591-1664", industry: nil, primary_industry: nil, hazardous: nil, food_grade: nil, freight_revenue: nil, pdm_id: nil, poc_id: nil, volume_intra: nil, volume_inter: nil, volume_to_usa: nil, volume_from_usa: nil, notes: "<p><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; white-space: pre-wrap; text-decoration-skip-ink: none;\">01/23 Dustin introduced me to Joanne, Quoted on Avocados from Phar (fresh house) - Ontario, Califormia (LA) @ $3800 - she wanted delivery 12 am , trucks I spoke with said this would be tight so I advised her on this - not a problem but will be tight (3.2 days for delivery 1600m Miles) and her response was as follows: Hi Amanda, Thank you for your prompt reply and rate. Your rate is in line with others we received, and I thank you. However I did have to go with making the delivery deadline on this one. I have your contact information, and will be sure to reach out on the next one as well. Joanne --- cleared this up so we wont be missing out again. Rate TTT was @ $3200 so decent margin to get in. 01/30 FROM JOANNE MORGAN : Was hoping to get a rate from you for 2 scenarios as below if possible: PU Pharr, TX Drop 1- LA, CA Drop 2- Union Springs, CA 8 pallets and- PU Pharr, TX Drop Union Springs, CA 8 pallets Please advise rate, and when we would have to load in TX to make OTD? Thank you in advance, Joanne </span><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; white-space: pre-wrap; color: #ff9900; text-decoration-skip-ink: none;\">02/01 rate @ $5500, now 11 pallets. They confirmed rate is good. Found capacity @ 3k TTT with On-Time Trucking mc 942084 Customer Delivery date is going to need to be SATURDAY, truck backed out requesting thursday / friday this is only 2k miles and can be done much sooner than sat...Working on recovering - otherise reposting. - Avocado - was unable to recover a new truck for their dates</span></p>", credit_status: nil, credit_approval: nil, origin: nil, destination: nil, head_office: 74, annual_revenue: nil, created_at: "2019-02-14 20:46:00", updated_at: "2019-02-14 20:46:00", years_in_business: 0, complete_record: true, website: "www.naturipefarms.com", linkedin: "https://www.linkedin.com/in/dustin-hahn-a2582a27/", sales_priority: "B", shipper_type: "Shipper,Receiver", control_freight: true, loads_per_month: "11-50", spend_per_year: "", commodities: "Mixed Fruits,Mixed Vegetables,Avocado", commodities_notes: "<p><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; text-align: center; white-space: pre-wrap;\">Avocado - with connects to other naturipe offices which handle other commodies in produce</span></p>", blue_book_score: nil, blue_book_url: "https://apps.bluebookservices.com/BBOS/CompanyDetailsSummary.aspx?CompanyID=348292", buying_criteria: "Price", works_with_brokers: true, price_sensitivity: "Market", challenges: "", current_carrier_mix: "", prefer_teams: false, last_contact_by: nil, last_contact: nil, relationship_owner: 9, load_last_month: 0, load_last_6_month: 0, approved: true, date_approved: "2019-02-14", years_established: nil},
