  {id: 49, company_name: "Pack-Right, L.L.C.", parent_id: nil, phone: "(520) 377-2877", industry: nil, primary_industry: nil, hazardous: nil, food_grade: nil, freight_revenue: nil, pdm_id: 23, poc_id: nil, volume_intra: nil, volume_inter: nil, volume_to_usa: nil, volume_from_usa: nil, notes: "<p><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; white-space: pre-wrap;\">01/30 I called Jordan on his cell 1st, discussed potentail and load oppertunity seemed to be ok, 3 + loads weekly mix veg out of mcallen, nogales, san diego CA and some Florida. Nice lanes. He requested our bluebook info - all looked good and he introduced me to Danny the Sales Coordinator. 01/30 got ahold of danny @ the his cell # 520 275-4515 . Discussed blue book, lanes were same as jordan and I had discussed. He explained that he actually moved 1 load with us in aug 2018 (found in customers so they are already set up with us - previously he said he spoke with Colin here @ scout) . I sent him some rates as per the following and the rates were in line : McAllen &ndash; NY (Brooklyn / Bronx) $5200 McAllen &ndash; Chicago IL $3200 McAllen &ndash; NJ $5100 McAllen &ndash; PA $4900 McAllen &ndash; MD $4800 San Diego CA &ndash; NY (Brooklyn / Bronx) $5600 San Diego CA &ndash; Boston, MA $6100 San Diego CA &ndash; NJ $5500 San Diego CA &ndash; CT $5800 Nogales &ndash; NY (Brooklyn / Bronx) $5600 Nogales &ndash; Boston, MA $6100 Nogales &ndash; NJ $5500 Nogales &ndash; CT $5800 Danny explaiined the rates are fine and in line, he wasnt avoidin giving us loads in the past he is just mostly FOB. I asked for an intoduction to his customers that arrange their own freight - nothing yet will stay on him - gently for those refferals. Closing right now - no oppertunity - pushing for refferals that I might be able to open in Feb wit him. He wasn't looking for any freight for today/ this week either. --------------- reopening (oppertunity here) 01/30email from Danny : Reefer Needed in Nogales Arizona You will Pick up at Pack Right 30 Old Tucson Road Nogales Arizona, today, Wednesday 1/30/19 The shipping Foreman name is Ray (Cell 520-415-4633, Email ray@packrightllc.com) There will be One Pick and Two Drops 1st drop will deliver to Merced CA on Friday 02/01/19--7:00 am Pick up # Pack Right 91871 2nd drop will deliver to Roseville CA Friday 02/01/19--12:30 pm Pick Up # Pack Right 91872 Lumper fees reimbursed Product Fresh Tomatoes Temperature to be set at 50 degrees continues run Weight should be around 43,500 Pounds If you have a truck available, please call or email your rate Thanks Danny Catano Pack Right LLC. P 520-377-2877 quoted $2400 for the above load - Carrier @2k TTT He covered the load before I could confirm a truck, rate was in line, he covered it for $2200. Closing as was originally due to FOB Status, these FTL oppertunities are few and faw in between. -----02/14 follow up call 3 pm est today with Danny 02/14 we are going to connect tomorrow as he was between warehouses today</span></p>", credit_status: nil, credit_approval: nil, origin: nil, destination: nil, head_office: 78, annual_revenue: nil, created_at: "2019-02-14 21:05:21", updated_at: "2019-02-14 21:40:40", years_in_business: 0, complete_record: false, website: "", linkedin: "", sales_priority: "B", shipper_type: "", control_freight: false, loads_per_month: "11-50", spend_per_year: "", commodities: "", commodities_notes: "<p><span style=\"font-family: Nunito, Arial; font-size: 11pt; font-weight: bold;\">Tomatoes, Cucumber, Peppers, Squash and Corn and more&nbsp;</span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Nunito, Arial; font-weight: bold;\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Tomatoes, Cucumber, Peppers, Squash and Corn and more &quot;}\" data-sheets-userformat=\"{&quot;2&quot;:359233,&quot;3&quot;:{&quot;1&quot;:0},&quot;9&quot;:0,&quot;11&quot;:3,&quot;12&quot;:0,&quot;14&quot;:[null,2,0],&quot;15&quot;:&quot;Nunito&quot;,&quot;16&quot;:11,&qu