  {id: 51, company_name: "West Pak Avocado, Inc.", parent_id: nil, phone: "(951) 252-8000", industry: nil, primary_industry: nil, hazardous: nil, food_grade: nil, freight_revenue: nil, pdm_id: nil, poc_id: nil, volume_intra: nil, volume_inter: nil, volume_to_usa: nil, volume_from_usa: nil, notes: "<p><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; white-space: pre-wrap;\">Spoke with Johnny in Murrieta, CA (Logistics) and Scott in Philly (Sales Director). Will need to get more info on this one - busy time, was receptive and open to doing businss however waiting to hear back on my rates &bull; Murrieta, CA &ndash; New Jersey $6500 &bull; Murrieta, CA &ndash; Bronx, NY $6700 &bull; Mcallen TX &ndash; Bronx, NY $5100 &bull; Mcallen TX - New Jersey $5000 &bull; Yuma AZ - New Jersey $5100 &bull; Yuma AZ - Bronx, NY $5000 rates were ok for him , follow up for first load oppertunity I keep catching him right in the middle of a task will have more time to discuss opperunities and other lanes late rin the week. Will send app then to be top of mind. To follow up in Jan, offered load but app not in system can't service, moving on until app in system may re-open next month. -----01/17Hi Johnny, Here you go, please let me know if these rates work for you. We do a lot of business from TX &ndash; the East Coast (NY, MD, NJ, CT ++ ) so these would be a great fit for our trucks who run these lanes consistently. Do you know which days these normally run on? I&rsquo;m Persistent on wanting to earn your business and getting to know what you needs are regularly. Some of rates for today : &bull; Dallas, TX &ndash; New Jersey $4400 &bull; Dallas, TX &ndash; Bronx, NY $4500 &bull; Dallas, TX &ndash; Los Angeles, CA $2600 &bull; Dallas, TX - Chicago, IL $1800 + unloading. called for feedback on these but was unable to get him on the line will follow up. accordingly below are TTT rates on Dallas, TX quotes above: &bull; Dallas, TX &ndash; New Jersey $3900 TTT &bull; Dallas, TX &ndash; Bronx, NY $4000 TTT &bull; Dallas, TX &ndash; Los Angeles, CA $2100 TTT &bull; Dallas, TX - Chicago, IL $1450 TTT -------01/23 auto reply also tried to reach out by phone no luck - I will be out of the office and Country until Monday 28 Janaury.</span></p>\r\n<p><span style=\"font-family: docs-Nunito; font-size: 15px; font-weight: bold; white-space: pre-wrap;\">02/13 fu n/aa</span></p>", credit_status: nil, credit_approval: nil, origin: nil, destination: nil, head_office: 80, annual_revenue: nil, created_at: "2019-02-14 21:17:50", updated_at: "2019-02-14 21:17:50", years_in_business: 0, complete_record: false, website: "westpakavocado.com", linkedin: "", sales_priority: "", shipper_type: "", control_freight: true, loads_per_month: "", spend_per_year: "", commodities: "Avocado", commodities_notes: "", blue_book_score: "814", blue_book_url: "https://apps.bluebookservices.com/BBOS/CompanyDetailsSummary.aspx?CompanyID=117036", buying_criteria: "Price", works_with_brokers: true, price_sensitivity: "", challenges: "", current_carrier_mix: "", prefer_teams: false, last_contact_by: nil, last_contact: nil, relationship_owner: 9, load_last_month: 0, load_last_6_month: 0, approved: false, date_approved: nil, years_established: nil},
